			{ id: 3, follow: true, name: "Даун Лохыч", status: "Ты лоъх!", country: "Россия, ", city: "Москва", age: 36 }
			]

}

const usersReducer = (state = initialState, action) => {
	
	switch(action.type) {
		default:
			return state;
	}
}

const followAC = () => ({type: FOLLOW});
